const persona = {
    nombre: 'Tony',
    edad: 45,
    clave: 'Iron Man'
};

const retornaPersona = ({ nombre, edad, clave }) => {
    console.log(nombre + ' , ' + edad + ' , ' + clave);
}

retornaPersona(persona);
